  private static void InitializeStandardEncoding()
  {
    PredefinedTextEncoding.StandardEncoding = new PredefinedTextEncoding();
    PredefinedTextEncoding.StandardEncoding.Init();
    PredefinedTextEncoding.StandardEncoding.names = (string[]) PresettedEncodings.StandardEncoding.Clone();
    PredefinedTextEncoding.StandardEncoding.InitMapping();
  }

  public static PredefinedTextEncoding GetPredefinedEncoding(string encoding)
  {
    switch (encoding)
    {
      case "PdfDocEncoding":
        return PredefinedTextEncoding.PdfDocEncoding;
      case "MacRomanEncoding":
        return PredefinedTextEncoding.MacRomanEncoding;
      case "WinAnsiEncoding":
        return PredefinedTextEncoding.WinAnsiEncoding;
      case "StandardEncoding":
        return PredefinedTextEncoding.StandardEncoding;
      default:
        return (PredefinedTextEncoding) null;
    }
  }

  static PredefinedTextEncoding()
  {
    if (PredefinedTextEncoding.PdfDocEncoding == null || PredefinedTextEncoding.PdfDocEncoding.names.Length == 0)
      PredefinedTextEncoding.InitializePdfEncoding();
    if (PredefinedTextEncoding.MacRomanEncoding == null || PredefinedTextEncoding.MacRomanEncoding.names.Length == 0)
      PredefinedTextEncoding.InitializeMacEncoding();
    if (PredefinedTextEncoding.StandardMacRomanEncoding == null || PredefinedTextEncoding.StandardMacRomanEncoding.names.Length == 0)
      PredefinedTextEncoding.InitializeStandardMacEncoding();
    if (PredefinedTextEncoding.StandardEncoding == null || PredefinedTextEncoding.StandardEncoding.names.Length == 0)
      PredefinedTextEncoding.InitializeStandardEncoding();
    if (PredefinedTextEncoding.WinAnsiEncoding != null && PredefinedTextEncoding.WinAnsiEncoding.names.Length != 0)
      return;
    PredefinedTextEncoding.InitializeWinAnsiEncoding();
  }

  private void Init()
  {
    this.names = new string[256 /*0x0100*/];
    for (int index = 0; index < 256 /*0x0100*/; ++index)
      this.names[index] = ".notdef";
  }

  private void InitMapping()
  {
    if (this.mapping != null)
      return;
    this.mapping = new Dictionary<string, byte>(this.names.Length);
    for (int index = 0; index < this.names.Length; ++index)
    {
      if (this.names[index] != null)
        this.mapping[this.names[index]] = (byte) index;
    }
  }

  public string[] GetNames() => (string[]) this.names.Clone();

  public byte GetCharId(string name) => this.mapping[name];

  internal static void InitializePredefinedEncoding()
  {
    PredefinedTextEncoding.InitializePdfEncoding();
    PredefinedTextEncoding.InitializeMacEncoding();
    PredefinedTextEncoding.InitializeStandardMacEncoding();
    PredefinedTextEncoding.InitializeStandardEncoding();
    PredefinedTextEncoding.InitializeWinAnsiEncoding();
  }

  internal static void Dispose()
  {
    if (PredefinedTextEncoding.PdfDocEncoding.mapping != null)
      PredefinedTextEncoding.PdfDocEncoding.mapping.Clear();
    if (PredefinedTextEncoding.MacRomanEncoding.mapping != null)
      PredefinedTextEncoding.MacRomanEncoding.mapping.Clear();
    if (PredefinedTextEncoding.StandardEncoding.mapping != null)
      PredefinedTextEncoding.StandardEncoding.mapping.Clear();
    if (PredefinedTextEncoding.StandardMacRomanEncoding.mapping != null)
      PredefinedTextEncoding.StandardMacRomanEncoding.mapping.Clear();
    if (PredefinedTextEncoding.WinAnsiEncoding.mapping != null)
      PredefinedTextEncoding.WinAnsiEncoding.mapping.Clear();
    if (PredefinedTextEncoding.PdfDocEncoding.names != null)
      PredefinedTextEncoding.PdfDocEncoding.names = new string[0];
    if (PredefinedTextEncoding.MacRomanEncoding.names != null)
      PredefinedTextEncoding.MacRomanEncoding.names = new string[0];
    if (PredefinedTextEncoding.StandardEncoding.names != null)
      PredefinedTextEncoding.StandardEncoding.names = new string[0];
    if (PredefinedTextEncoding.StandardMacRomanEncoding.names != null)
      PredefinedTextEncoding.StandardMacRomanEncoding.names = new string[0];
    if (PredefinedTextEncoding.WinAnsiEncoding.names == null)
      return;
    PredefinedTextEncoding.WinAnsiEncoding.names = new string[0];
  }
